        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4b0x-9693-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd317d9adg4', 'terms.block_5.text.1', 'Die Gesamtkosten des Abonnements werden auf jeder Seite angegeben, auf der Sie die 100% Sport-Dienste abonnieren können. Gesamt- oder Teilbeträge des vertraglich vereinbarten Dienstes werden wöchentlich oder täglich in Rechnung gestellt, wie von Ihrem Mobilfunkanbieter angegeben. Der Höchstpreis für das Abonnement beträgt jedoch %price% %currency%')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-40x8-9693-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd317d9adg4', 'terms.block_5.text.2', 'Postpaid-Nutzern werden die Kosten ihrer Handy-Rechnung hinzugefügt. Wenn Sie ein Prepaid-Nutzer sind, stellen Sie sicher, dass auf Ihrer Prepaid-Karte ausreichend Guthaben vorhanden ist, um Ihr Abonnement und/oder Ihren Kauf abzuschließen.')");
