        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-0xbf-4b38-9693-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd317d9adg4', 'terms.block_6.text.1', 'Nur volljährige und unabhängige Minderjährige (über 14 Jahre) können die Dienste von 100% Sport beantragen und in Anspruch nehmen. Unmündige Minderjährige können die 100% Sport-Dienste nur mit Genehmigung ihrer Eltern oder Erziehungsberechtigten nutzen. Diese sind in jedem Fall für die Handlungen ihrer Angehörigen verantwortlich. 100% Sport kann in keiner Weise die elterliche Kontrolle von Erziehungsberechtigten ersetzen, so dass der Besitzer der Mobiltelefonleitung für alle Auswirkungen verantwortlich ist.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1da0x-efbf-4b38-9693-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd317d9adg4', 'terms.block_6.text.2', 'Sie sollten über alle erforderlichen Ressourcen (Mobilgerät, Software, Internetverbindung) verfügen, um die 100% Sport-Dienste nutzen zu können. 100% Sport kann seine Dienste einstellen, um Reparaturen, Korrekturen und Wartungsarbeiten durchzuführen. 100% Sport kann auch vorübergehend oder dauerhaft bestimmte Dienste oder Produkte modifizieren.')");
