        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-7r38-9693-7cd0e0dcc1ba', '5179f17c-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd317d9adg4', 'terms.block_7.text.1', 'Pursuant to §356 BGB (German Civil Code), you have the right to withdraw from a contract concluded with us for the 100% Sport service within 14 (fourteen) days without giving reasons, starting from the day of the conclusion of the contract. The exercise of the right of withdrawal means that you have nothing to pay or a payment made to you to be refunded. You can find the model withdrawal form here: <a href=\"%form_url%\" download>withdrawal form</a>')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-ef7r-4b38-9693-7cd0e0dcc1ba', '5179f17c-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd317d9adg4', 'terms.block_7.text.2', 'The right of revocation expires according to paragraph § 356, 5 BGB, if you have agreed that we start execution of the contract before the expiry of the revocation period, you your knowledge that you lose your right of revocation by your consent with the start of the contract and we then begin to execute the contract.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-e7rf-4b38-9693-7cd0e0dcc1ba', '5179f17c-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd317d9adg4', 'terms.block_8.title.1', 'User’s liability')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-7rbf-4b38-9693-7cd0e0dcc1ba', '5179f17c-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd317d9adg4', 'terms.block_8.text.1', '100% sport is not liable for any loss or injuries due to inappropriate use of the service provided by 100% sport beyond its control or resulting from causes not attributable to it. You are required not misuse 100% sport services and respect the laws of third parties including trademark rights, patents, copyright and other intellectual and industrial properties.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1da7r-efbf-4b38-9693-7cd0e0dcc1ba', '5179f17c-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd317d9adg4', 'terms.block_8.text.2', 'Likewise, you acknowledge and agree that the use of 100% sport services is not allowed for commercial purposes and any other unrelated purposes described in these Terms and Conditions.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1d7re-efbf-4b38-9693-7cd0e0dcc1ba', '5179f17c-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd317d9adg4', 'terms.block_9.title.1', '100% sports liability')");
