        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a7raee-efbf-4b38-9693-7cd0e0dcc1ba', '5179f17c-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd317d9adg4', 'terms.block_9.text.2', '100% sport is not responsible in case of products or services requested are not delivered or rendered properly when this issue cannot be attributed to 100% sport causes (including, but not limited to, situations like your video cannot be loaded due to operator connectivity problems or technical issues related to your handset configuration).')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a17rdaee-efbf-4b38-9693-7cd0e0dcc1ba', '5179f17c-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd317d9adg4', 'terms.block_9.text.3', 'If you detect any illegal content, <a href=\"%contact_us_url_%\">contact us</a> immediately.')");
