        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('7ra1daee-efbf-4b38-9693-7cd0e0dcc1ba', '5179f17c-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd317d9adg4', 'terms.block_10.text.1', 'All contents, games, designs and programming codes inside 100% sport mobile portal are fully protected by copyright: reproduction, communication, dissemination and distribution of any element is completely forbidden unless you have the necessary authorization.')");
