        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9693-7cd0e0dcc9fa', '5179f17c-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd317d9adg4', 'terms.block_10.text.3', '100% sport reserves the right to unilaterally remove, add or modify any content, services or utilities available on 100% sport mobile website.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9693-7cd0e0dc9fba', '5179f17c-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd317d9adg4', 'terms.block_11.title.1', 'Personal data')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9693-7cd0e0d9f1ba', '5179f17c-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd317d9adg4', 'terms.block_11.text.1', 'Pursuant to Data Protection Act 1998, the user has the right to access, rectify and/or oppose any personal data by writing to the data controller ORIGINDATA Ltd, 3rd Floor, 207 Regent Street, London W1B 3HH, UK.')");
