        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9693-7cd02cd0x1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d9d7d9a', 'terms.block_1.text.1', '100% Sport ist ein mobiler Dienst, der mobile Spiele anbietet. Der 100% Sport bietet an: - Wöchentliches Abonnement, das automatisch aktiviert wird, wenn Sie Ihr Abonnement auf der <a href=\"%home_url%\">100% Mobile Sport</a> bestätigen.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9693-7cd2c00xc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d9d7d9a', 'terms.block_2.title.1', 'Bedingungen')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9693-7c2ce0xcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d9d7d9a', 'terms.block_2.text.1', 'Dieser Service steht nur Nutzern in Deutschland zur Verfügung. Sie benötigen die Erlaubnis des Netzbetreibers, um diesen Dienst zu nutzen.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9693-72c00xdcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d9d7d9a', 'terms.block_3.title.1', 'Leistungsbeschreibung')");
