        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4b38-962c-7c0xe0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d9d7d9a', 'terms.block_3.text.1', 'Mit diesem Abo-Service können Sie auf Ihrem Handy jede Woche unbegrenzt Sportvideos aus dem Katalog von 100% Sport für %price% %currency% inkl. MwSt. ansehen (+ WAP-Verbindungsgebühren). Solange Sie 100% Sport abonniert haben, können Sie jede Woche unbegrenzt Inhalte anschauen.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4b38-92c3-70x0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d9d7d9a', 'terms.block_3.text.2', 'Um am Abo-Dienst teilzunehmen und Zugang zu Spielen und Videos zu erhalten, klicken Sie auf den Abo-Button auf der 100% Sport Mobile Website. Sobald Ihr Abonnement bestätigt ist, werden Sie auf unsere Homepage weitergeleitet und können unbegrenzt Spiele und Sportvideos gemäß dem Katalog von 100% Sport genießen.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4b38-2c93-0xd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d9d7d9a', 'terms.block_3.text.3', 'Ihr wöchentliches Abonnement wird automatisch verlängert, es sei denn, Sie kündigen das Abonnement. Sie können Ihr Abonnement jederzeit über Ihr persönliches Menü kündigen, indem Sie auf den Link Mein 100% Sport Verlassen klicken. 100% Sport behält sich das Recht vor, das Abonnement jederzeit zu beenden.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4b2c-960x-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d9d7d9a', 'terms.block_4.title.1', 'Hilfe und Unterstützung')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-42c8-90x3-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d9d7d9a', 'terms.block_4.text.1', 'Kontaktieren Sie Uns')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-2c38-0x93-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d9d7d9a', 'terms.block_5.title.1', 'Zahlungen')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-ef2c-4b0x-9693-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d9d7d9a', 'terms.block_5.text.1', 'Die Gesamtkosten des Abonnements werden auf jeder Seite angegeben, auf der Sie die 100% Sport-Dienste abonnieren können. Gesamt- oder Teilbeträge des vertraglich vereinbarten Dienstes werden wöchentlich oder täglich in Rechnung gestellt, wie von Ihrem Mobilfunkanbieter angegeben. Der Höchstpreis für das Abonnement beträgt jedoch %price% %currency%')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-e2cf-40x8-9693-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d9d7d9a', 'terms.block_5.text.2', 'Postpaid-Nutzern werden die Kosten ihrer Handy-Rechnung hinzugefügt. Wenn Sie ein Prepaid-Nutzer sind, stellen Sie sicher, dass auf Ihrer Prepaid-Karte ausreichend Guthaben vorhanden ist, um Ihr Abonnement und/oder Ihren Kauf abzuschließen.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-2cbf-0x38-9693-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d9d7d9a', 'terms.block_5.text.3', 'Die Gebühren können je nach Mobilfunkanbieter unterschiedlich sein. Der genaue Preis wird zusammen mit den Bedingungen des Dienstes vor Ihrem Abonnement oder Kauf angezeigt.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1da2c-ef0x-4b38-9693-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d9d7d9a', 'terms.block_5.text.4', 'Der Zugang zum 100% Sport über eine mobile 3G- oder 4G-Verbindung kann zusätzliche Navigationskosten verursachen. Die Höhe dieser Kosten hängt von den Tarifen und Bedingungen gemäß Vertrag mit Ihrem Mobilfunkanbieter ab. 100% Sport kann daher nicht für diese Kosten verantwortlich gemacht werden.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1d2ce-e0xf-4b38-9693-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d9d7d9a', 'terms.block_6.title.1', 'Dienstzugang')");
