        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9619-7c0xe0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d97d9a4', 'terms.block_3.text.1', 'Mit diesem Abo-Service können Sie auf Ihrem Handy jede Woche unbegrenzt Sportvideos aus dem Katalog von 100% Sport für %price% %currency% inkl. MwSt. ansehen (+ WAP-Verbindungsgebühren). Solange Sie 100% Sport abonniert haben, können Sie jede Woche unbegrenzt Inhalte anschauen.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9193-70x0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d97d9a4', 'terms.block_3.text.2', 'Um am Abo-Dienst teilzunehmen und Zugang zu Spielen und Videos zu erhalten, klicken Sie auf den Abo-Button auf der 100% Sport Mobile Website. Sobald Ihr Abonnement bestätigt ist, werden Sie auf unsere Homepage weitergeleitet und können unbegrenzt Spiele und Sportvideos gemäß dem Katalog von 100% Sport genießen.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4b38-1993-0xd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d97d9a4', 'terms.block_3.text.3', 'Ihr wöchentliches Abonnement wird automatisch verlängert, es sei denn, Sie kündigen das Abonnement. Sie können Ihr Abonnement jederzeit über Ihr persönliches Menü kündigen, indem Sie auf den Link Mein 100% Sport Verlassen klicken. 100% Sport behält sich das Recht vor, das Abonnement jederzeit zu beenden.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4b19-960x-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d97d9a4', 'terms.block_4.title.1', 'Hilfe und Unterstützung')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4198-90x3-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d97d9a4', 'terms.block_4.text.1', 'Kontaktieren Sie Uns')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-1938-0x93-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d97d9a4', 'terms.block_5.title.1', 'Zahlungen')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-ef19-4b0x-9693-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d97d9a4', 'terms.block_5.text.1', 'Die Gesamtkosten des Abonnements werden auf jeder Seite angegeben, auf der Sie die 100% Sport-Dienste abonnieren können. Gesamt- oder Teilbeträge des vertraglich vereinbarten Dienstes werden wöchentlich oder täglich in Rechnung gestellt, wie von Ihrem Mobilfunkanbieter angegeben. Der Höchstpreis für das Abonnement beträgt jedoch %price% %currency%')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-e19f-40x8-9693-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d97d9a4', 'terms.block_5.text.2', 'Postpaid-Nutzern werden die Kosten ihrer Handy-Rechnung hinzugefügt. Wenn Sie ein Prepaid-Nutzer sind, stellen Sie sicher, dass auf Ihrer Prepaid-Karte ausreichend Guthaben vorhanden ist, um Ihr Abonnement und/oder Ihren Kauf abzuschließen.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-19bf-0x38-9693-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d97d9a4', 'terms.block_5.text.3', 'Die Gebühren können je nach Mobilfunkanbieter unterschiedlich sein. Der genaue Preis wird zusammen mit den Bedingungen des Dienstes vor Ihrem Abonnement oder Kauf angezeigt.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1da19-ef0x-4b38-9693-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d97d9a4', 'terms.block_5.text.4', 'Der Zugang zum 100% Sport über eine mobile 3G- oder 4G-Verbindung kann zusätzliche Navigationskosten verursachen. Die Höhe dieser Kosten hängt von den Tarifen und Bedingungen gemäß Vertrag mit Ihrem Mobilfunkanbieter ab. 100% Sport kann daher nicht für diese Kosten verantwortlich gemacht werden.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1d19e-e0xf-4b38-9693-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d97d9a4', 'terms.block_6.title.1', 'Dienstzugang')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a119ee-0xbf-4b38-9693-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d97d9a4', 'terms.block_6.text.1', 'Nur volljährige und unabhängige Minderjährige (über 14 Jahre) können die Dienste von 100% Sport beantragen und in Anspruch nehmen. Unmündige Minderjährige können die 100% Sport-Dienste nur mit Genehmigung ihrer Eltern oder Erziehungsberechtigten nutzen. Diese sind in jedem Fall für die Handlungen ihrer Angehörigen verantwortlich. 100% Sport kann in keiner Weise die elterliche Kontrolle von Erziehungsberechtigten ersetzen, so dass der Besitzer der Mobiltelefonleitung für alle Auswirkungen verantwortlich ist.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a19a0x-efbf-4b38-9693-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d97d9a4', 'terms.block_6.text.2', 'Sie sollten über alle erforderlichen Ressourcen (Mobilgerät, Software, Internetverbindung) verfügen, um die 100% Sport-Dienste nutzen zu können. 100% Sport kann seine Dienste einstellen, um Reparaturen, Korrekturen und Wartungsarbeiten durchzuführen. 100% Sport kann auch vorübergehend oder dauerhaft bestimmte Dienste oder Produkte modifizieren.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a119d0xe-efbf-4b38-9693-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d97d9a4', 'terms.block_7.title.1', 'WIDERRUFSRECHT (Widerrufsbelehrung)')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1910xee-efbf-4b38-9693-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d97d9a4', 'terms.block_7.text.1', 'Gemäß §356 BGB haben Sie grundsätzlich das Recht, von einem mit uns im Fernabsatz für den 100% Sport Dienst abgeschlossen Vertrag innerhalb von 14 (vierzehn) Tagen ohne Angabe von Gründen zurücktreten, dies ab dem Tag des Vertragsabschlusses. Die Ausübung des Rücktrittsrechts führt dazu, dass Sie nichts zu bezahlen haben bzw. eine erfolgte Zahlung an Ihnen zurückzuerstatten ist. Das Muster-Widerrufsformular können Sie hier finden: <a href=\"%form_url%\" download>Widerrufsformular bilden</a>')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('19a0xaee-efbf-4b38-9693-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d97d9a4', 'terms.block_7.text.2', 'Das Widerrufsrecht erlischt nach § 356 Abs. 5 BGB, wenn Sie zugestimmt haben, dass wir mit Ausführung des Vertrags vor Ablauf der Widerrufsfrist beginnen, Sie Ihre Kenntnis, dass Sie durch Ihre Zustimmung mit Beginn der Ausführung des Vertrags Ihr Widerrufsrecht verlieren und wir sodann mit der Ausführung des Vertrags beginnen.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a0x1daee-efbf-4b38-9693-7cd0e0dcc1l2', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d97d9a4', 'terms.block_8.title.1', 'Haftung des Nutzers')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('0xa1daee-efbf-4b38-9693-7cd0e0dccl2a', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d97d9a4', 'terms.block_8.text.1', '100% Sport haftet nicht für Verluste oder Verletzungen, die durch unangemessene Nutzung des von 100% Sport angebotenen Dienstes entstehen, die sich seiner Kontrolle entziehen oder auf Ursachen beruhen, die nicht 100% Sport zuzuschreiben sind. Sie dürfen die 100% Sport-Dienste nicht missbrauchen und müssen die Gesetze Dritter einhalten, einschließlich Markenrechte, Patente, Urheberrechte und andere geistige und gewerbliche Eigentümer.')");
