        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9693-7cd0e0dl27ra', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d97d9a4', 'terms.block_9.title.1', 'Haftung von 100% Sport')");
