        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9693-7cd0el27r1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d97d9a4', 'terms.block_9.text.2', '100% Sportist nicht verantwortlich im Falle, dass die angeforderten Produkte oder Dienste nicht ordnungsgemäß geliefert oder erbracht werden, wenn dieses Problem nicht auf das Verschulden von 100% Sport zurückzuführen ist (einschließlich, aber nicht beschränkt auf Situationen, in denen Ihr Produkt aufgrund von Verbindungsproblemen des Betreibers oder technischen Problemen mit der Konfiguration Ihres Mobilgerätes nicht heruntergeladen werden kann).')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9693-7cd0l27rc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d97d9a4', 'terms.block_9.text.3', 'Wenn Sie illegale Inhalte entdecken, <a href=\"%contact_us_url%\">kontaktieren</a> Sie uns sofort')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9693-7cdl27rcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d97d9a4', 'terms.block_10.title.1', 'Geistiges und gewerbliches Eigentum')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9693-7cl27rdcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d97d9a4', 'terms.block_10.text.1', 'Sämtliche Inhalte, Spiele, Designs und Programmcodes im 100% sport sind vollständig urheberrechtlich geschützt: Die Reproduktion, Kommunikation, Verteilung und Verbreitung jeglicher Elemente ist ohne die erforderliche Genehmigung vollständig verboten.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9693-7l27r0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d97d9a4', 'terms.block_10.text.2', 'Darüber hinaus sind alle Symbole (Logos, Schriftarten, Icons usw.) im 100% sport Eigentum von 100% sport oder Dritten, und ihre Reproduktion oder Verbreitung ist ohne ausdrückliche Genehmigung vollständig verboten. Es ist auch untersagt, diese Allgemeinen Geschäftsbedingungen ganz oder teilweise ohne Zustimmung von 100% sport zu kopieren, zu reproduzieren oder zu verwenden.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9693-l27re0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d97d9a4', 'terms.block_10.text.3', '100% sport behält sich das Recht vor, Inhalte, Dienste oder Dienstprogramme, die im 100% sport verfügbar sind, einseitig zu entfernen, hinzuzufügen oder zu verändern.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4b38-96l2-77r0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d97d9a4', 'terms.block_11.title.1', 'Persönliche Daten')");
