        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-ef7r-4b38-9693-7cd0e66cc1ba', '5179f17c-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d97d9a4', 'terms.block_7.text.2', 'The right of revocation expires according to paragraph § 356, 5 BGB, if you have agreed that we start execution of the contract before the expiry of the revocation period, you your knowledge that you lose your right of revocation by your consent with the start of the contract and we then begin to execute the contract.')");
