        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4b38-96g0-7c0xe0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d7d9ag4', 'terms.block_3.text.1', 'Mit diesem Abo-Service können Sie auf Ihrem Handy jede Woche unbegrenzt Sportvideos aus dem Katalog von 100% Sport für %price% %currency% inkl. MwSt. ansehen (+ WAP-Verbindungsgebühren). Solange Sie 100% Sport abonniert haben, können Sie jede Woche unbegrenzt Inhalte anschauen.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4b38-9g03-70x0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d7d9ag4', 'terms.block_3.text.2', 'Um am Abo-Dienst teilzunehmen und Zugang zu Spielen und Videos zu erhalten, klicken Sie auf den Abo-Button auf der 100% Sport Mobile Website. Sobald Ihr Abonnement bestätigt ist, werden Sie auf unsere Homepage weitergeleitet und können unbegrenzt Spiele und Sportvideos gemäß dem Katalog von 100% Sport genießen.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4b38-g093-0xd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d7d9ag4', 'terms.block_3.text.3', 'Ihr wöchentliches Abonnement wird automatisch verlängert, es sei denn, Sie kündigen das Abonnement. Sie können Ihr Abonnement jederzeit über Ihr persönliches Menü kündigen, indem Sie auf den Link Mein 100% Sport Verlassen klicken. 100% Sport behält sich das Recht vor, das Abonnement jederzeit zu beenden.')");
        $this->addSql("INSERT INTO translations (uuid, language_id, `carrier_id`, `key`, translation) VALUES ('a1a1daee-efbf-4bg0-960x-7cd0e0dcc1ba', '5179fa73-ebd4-11e8-95c4-02bb250f0f22', '3de06e41-f889-4f95-aac3-ebd31d7d9ag4', 'terms.block_4.title.1', 'Hilfe und Unterstützung')");
